import React from "react";
import { Page, Text, View, Document, StyleSheet } from '@react-pdf/renderer';

function LectionPage() {
  return (
    <Document>
    <Page size="A4">
      <View>
      </View>
      <View>
        <Text></Text>
      </View>
    </Page>
  </Document>
  );
}

export default LectionPage;
